--
-- Create table `cart`
--
CREATE TABLE cart (
  cartId char(36) NOT NULL,
  productId char(36) NOT NULL DEFAULT '' COMMENT 'Mã của sản phẩm',
  customerId char(36) NOT NULL DEFAULT '' COMMENT 'Mã của khách hàng',
  quantity int(11) NOT NULL COMMENT 'Số lượng ',
  total double DEFAULT NULL,
  createdDate datetime DEFAULT NULL,
  createdBy varchar(100) DEFAULT NULL,
  modifedDate datetime DEFAULT NULL,
  PRIMARY KEY (cartId)
)
ENGINE = INNODB,
CHARACTER SET utf8,
COLLATE utf8_general_ci,
COMMENT = 'Bảng lưu trữ thông tin giỏ hàng của khách hàng';

--
