    c.quantity,
    c.total
  FROM cart c
  WHERE c.customerId = customerId;
END
$$

--
-- Create procedure `procGetCarts`
--
CREATE PROCEDURE procGetCarts ()
SQL SECURITY INVOKER
COMMENT 'Hàm lấy danh sách giỏ hàng'
BEGIN
  SELECT
    c.cartId,
    c.productId,
    c.customerId,
    c.quantity,
